export const Test = () => {
  const [test, setTest] = useState("initial");

  useEffect(() => {
    console.log("first state", test)
    try {
      fetch("/api")
        .then((res) => console.log(res.json()))
        // .then((res) => setTest(data));
    } catch (error) {
      console.log("error =>", error);
    }
  }, []);

  return <h1>{test}</h1>;
};
